  [],\n\t\"num_tags\": 0,\n\t\"name\": \"nodc-standard-format-marine-birds-from-coastal-alaska-and-puget-sound-data-1979-marine-bird-sur\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Marine Bird Surveys (F041) is one of a
  group of seven datasets related tonMarine Birds from Coastal Alaska and Puget Sound
  Data (1979). Eachndataset uses the NODC Taxonomic Code to indicate species.nnMarine
  Bird Surveys (F041) data type contains data from fieldnobservations (land surveys)
  of marine birds and the environment in whichnthey were sighted. These data are collected
  to provide information onnpopulation density and distribution. Position, date, start
  time, elapsedntime and survey segment area and distance are recorded for each survey.nThe
  survey environment is described by vegetation type, geologicalncharacteristics,
  beach substrate, upland type, nearshore bathymetry,nmeteorological and tidal conditions.
  Species information includes numbernof individuals by age and sex. Information such
  as age, sex, location,ncondition, presence of oil and cause of death may also be
  reported fornindividual specimens. These data were collected in 1978 - 1979 for
  PugetnSound as part of the Marine EcoSystems Analysis (MESA) Puget SoundnProject.\",\n\t\"owner_org\":
